@Override
public synchronized boolean store(OutputStream output) throws IOException {

  if (this.normalCompletion == null) 
    return false;
  try {
    normalCompletion.getFST().save(new OutputStreamDataOutput(output));
  } finally {
    IOUtils.close(output);
  }
  return true;
}

